import React, {Component} from 'react';
import './App.css';

class App extends Component{

    showInfoProduct(product){
      if(product.status){
        return <h2>
                ID : {product.id}<br/>
                Name : {product.name}<br/>
                Age :  {product.age}<br/>
                Status : {product.status ? 'Active' : 'Pending'}<br/>
              </h2>
      }
    }
    render(){
          var a = 5;
          var b = 7;
          var product = {
            id : 1,
            name : 'Tinh',
            age : 20,
            status : true
          };

          var users = [
            {
              id : 1,
              name : 'ABC',
              age : 18
            },
            {
              id : 2,
              name : 'XYZ',
              age : 20
            },
            {
              id : 3,
              name : 'JKG',
              age : 30
            }

          ];

          var abc = users.map((user, index) => {
            return <div key={index}>
                      <h2>Ten : {user.name}</h2>
                      <p>Age : {user.age}</p>
                  </div>
          });
      return (
        <div>
          <nav className="navbar navbar-inverse">
            <div className="container-fluid">
              <a className="navbar-brand">Title</a>
              <ul className="nav navbar-nav">
                <li className="active">
                  <a>Home</a>
                </li>
                <li>
                  <a>Link</a>
                </li>
              </ul>
            </div>
          </nav> 
          <div className="ml-30">
          <h2>
            a : {a} <br/>
            b : {b} <br/>
            a + b = {a + b}
          </h2>

          {this.showInfoProduct(product)}
          <h2>
            {abc}
          </h2>

          </div>
        </div> 
      );
    }
  }


export default App;
